import styled from 'styled-components';

const HomePage = () => (
  <HomePageStyles>
    Make a coffee.
    <br />
    Light a candle.
    <br />
    Open a book.
    <br />
    This is your moment.
  </HomePageStyles>
);

export default HomePage;
